import { Route, Routes } from "react-router-dom";
import Login from "./screens/Login";
const App = () => {

  return (
    <div className="App">
      <Routes>
        <Route path="/ddd" element={<Login />}/>
      </Routes>
    </div>
  );
}

export default App;
